import axios from "./BasicUrl"

export const getCars = () => {
    return axios.get(`Cars`)
}

export const postCars = (car) => {
    return axios.post(`Cars`, car)
}

export const putCrsAvailable = (id) =>{
    return axios.put(`Cars?id=${id}`)
}
